var tipuesearch = {"pages": [{'title': 'About', 'text': '個人倉儲： https://github.com/41123234/cad2023 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Brython', 'text': 'https://en.wikipedia.org/wiki/Python_(programming_language) \n Examples: \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python Tutorial: \n https://docs.python.org/3/tutorial/ \n An informal introduction to Python \n Indentation (Python 採 4 個 Spaces 縮排, 以界定執行範圍) \n Variables ( Python Keywords ) \n Comments (# 單行註解, 三個單引號或三個雙引號標註多行註解) \n Numbers  (整數 int(), 浮點數 float()) \n Strings  (字串) \n print (Python 內建函式,  print()  函式) \n Python control flow tools \n for \n if \n range \n open \n read \n lists \n tuples \n dictionaries \n functions \n try ... except \n break \n pass \n classes \n 這個頁面 demo 如何在同一頁面下納入多個線上 Ace 編輯器與執行按鈕 ( practice_html.txt  動態頁面超文件). \n practice_html.txt  動態頁面超文件應該可以在啟動 Brython 時, 設定將 .py 檔案放入 downloads/py 目錄中引用. \n 亦即將所有對應的 html 也使用 Brython 產生, 然後寫為  class  後, 在範例導入時透過  instance  引用. \n <!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){\nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']});\n}\n</script> \n 從 1 累加到 100: \n 1 add to 100 \n 將 iterable 與 iterator  相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n', 'tags': '', 'url': 'Brython.html'}, {'title': '網路設定', 'text': '由於電腦輔助設計室某部分套件, 在 IPv4 網路環境下會被防毒軟體偵測到封包異常而封閉網路, 因此以下將 IPv4 網路關閉, 僅使用 IPv6, 並透過雙網路協定支援的代理主機設定, 以便與僅支援 IPv4 的網路主機連線。 \n \n \n \n 先從 這裡 確認你的班級序號 \n \n \n 下載 網路設定檔案 \n \n \n 同時下載 SCITE 編輯器: \xa0 wscite.7z \n \n \n 編輯修改 .ps1 中的 IPv6 固定位址, 放入自己的固定 IPv6 address \n \n \n', 'tags': '', 'url': '網路設定.html'}, {'title': '操作影片', 'text': '透過同組組員指導，並錄製。 \n 網路設定.mp4 \n', 'tags': '', 'url': '操作影片.html'}, {'title': '操作步驟', 'text': '步驟一  從mde .tw中，找到home選單底下的reval。   \n \n    步驟二  往後翻找至 "有關網路設定 "，並下載網路設定檔。   \n \n        步驟三  下載後並解壓逤。   \n \n    步驟四  將資料夾中的 "1 _disable _ipv4 "從 "SciTE "打開。   \n \n    步驟五  修改內文的 " 2 0 0 1 : 2 8 8 : 6 0 0 4 : 1 7 : 2 0 2 3 : c a d b : :序號 "  序號至 https://mde.tw/cadnote/content/links.html \xa0查看並修改。 \n \n', 'tags': '', 'url': '操作步驟.html'}, {'title': 'Wink', 'text': '學習如何利用 \xa0 Wink \xa0 製作電腦操作流程影片, 並將影片放入個人與分組網頁中. \n 首先使用者必須了解 \xa0 Wink \xa0 製作影片的功能與 \xa0 ShareX \xa0 相同, 都是依賴 \xa0 ffmpeg.exe . 意即使用 \xa0 Wink \xa0 之前必須在 Preferences 中先行設定 ffmpeg.exe 所在位置, 否則無法對所建立的專案轉為 mp4 檔案. \n 另外, 若擷取關鍵影格的電腦螢幕解析度大於 1008 x 630, 通常建立將影格 resize, 以方便使用者在手機上觀看影片. \n 利用 Wink 建立操作影片的步驟: \n \n 設定 ffmpeg.exe 所在位置, 若使用隨身碟中的可攜程式系統, 可將 ffmpeg.exe 放在 data 目錄中, 並以 wink_ffmpeg.reg 進行設定, 也可將 Wink 的啟動與 start_ipv6.bat 進行整合. \n 開啟 Wink 新專案. \n 每按下一次 Pause 鍵, 可擷取操作過程中的畫面影格 (利用 Zoomit 放大所要強調的操作內容, 並以紅線框列). \n 操作錄製結束後, 從右下方的 Tray 中, 以滑鼠左鍵點選, 在 Wink 圖示中, 以滑鼠右鍵帶出 Finish Capture 按鍵, 點選後即可回到 Wink 專案區. \n 在每一頁影格中加入註解說明 TextBox 之前, 先利用 Project - Resize All Frames 將影格縮小至 1008 x630. \n 完成註解說明後, 可以逐一移動各頁面滑鼠游標位置, 並決定各頁面影片播放時的停留時間. \n 最後以 Render 按鈕進行轉檔, 並利用 View Rendered Output 檢視所建立的操作影片. \n \n', 'tags': '', 'url': 'Wink.html'}, {'title': 'Wink操作影片', 'text': '\n', 'tags': '', 'url': 'Wink操作影片.html'}, {'title': 'W12', 'text': '', 'tags': '', 'url': 'W12.html'}, {'title': '座位表', 'text': '以下為參照 https://mde.tw/cadnote/downloads/2b_w12_seat.txt 及已知同學位置。 \n \n \n \n 41123220 \n 41123231 \n 41123215 \n \n 41123207 \n \n 411232212 \n 41123238 \n 41123237 \n \n \n \n 41123221 \n 41123208 \n 41123201 \n 41123234 \n 411232209 \n 41123230 \n 41123233 \n 41123205 \n \n \n \n 41136124 \n 41123226 \n 41123206 \n \n 41123227 \n 41123203 \n 41123202 \n 41123222 \n \n \n 41123214 \n 41123224 \n 41123210 \n 41123240 \n 41123218 \n \n \n 41123239 \n 41123245 \n \n \n 41123235 \n 41123229 \n 41123236 \n 41123251 \n 41123250 \n 41123246 \n 41123241 \n 41123243 \n 41123249 \n \n \n \n 41123211 \n 41123247 \n 41132222 \n 41123232 \n \n 41123217 \n 41123204 \n 41123216 \n \n \n \n \n 41136103 \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '座位表.html'}, {'title': '未知名單', 'text': '41123219 \n 41123228 41123244 \n 41123248 \n 41136126 \n 41136131 \n', 'tags': '', 'url': '未知名單.html'}, {'title': '分組作業', 'text': '', 'tags': '', 'url': '分組作業.html'}, {'title': '任務一"磁力吸引"', 'text': '繪圖過程 \n 使用SoildWorks 2023繪製 \n \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': '任務一"磁力吸引".html'}]};